import "./style.css";
import GoogleMapReact from 'google-map-react';

function Contact() {
  const mapOptions = {
    center: {
      lat: 51.5074, // Latitude of the map center
      lng: -0.1278 // Longitude of the map center
    },
    zoom: 10 // Zoom level of the map
  };

  return (
    <section className="contact">
      <div className="contact_top">
        <div>
          <h1>Contact us</h1>
        </div>
      </div>

      <div className="contact_container">
        <div className="left_side">
          <form class="form">
            {/* Form content */}
          </form>
        </div>
        <div className="right_side">
          {/* Google Map */}
          <div style={{ height: '400px', width: '100%' }}>
            <GoogleMapReact
              bootstrapURLKeys={{ key: 'YOUR_API_KEY' }} // Replace with your Google Maps API key
              defaultCenter={mapOptions.center}
              defaultZoom={mapOptions.zoom}
            >
              {/* Add markers or other components on the map */}
            </GoogleMapReact>
          </div>

          {/* Contact information */}
          <div>
            {/* Contact information content */}
          </div>
        </div>
      </div>
    </section>
  );
}

export default Contact;
